import React from 'react';

// components
function Fetuare(Props) {
    console.log(Props);
    return (
        <div className="fetuare">
            <div className="title">
                <h2>Phan Ngọc Dương</h2>
                <img src="" alt="" />
            </div>
        </div>
    );
}

function App() {
    const element = React.createElement(
        'div',
        { className: 'post-item' },
        React.createElement('h2', { title: 'Học React tại F8' }, 'ReactJs'),
        React.createElement('p', {
            children: 'Học react từ cơ bản đến nâng cao',
        }),
    );

    return (
        <div>
            <Fetuare></Fetuare>
        </div>
    );
}

export default App;
